# create a list of words from them
def minion_game2(s):
    vowels = 'AEIOU'
    s_len= len(s)
    total=[(s_len - i, 0) if s[i] in vowels else (0,s_len - i) for i in range(s_len)]
    k_tot = sum(total[i][0] for i in range(len(total)))
    s_tot = sum(total[i][1] for i in range(len(total)))
    if k_tot==s_tot:
        print('Draw')
    elif k_tot>s_tot:
        print('Kevin',k_tot)
    else:
        print('Stuart',s_tot)

minion_game2(string)

